INSERT INTO `cartos` (`id`, `titulo`, `subtitulo`, `icone`, `txt_botao`, `link`, `created_at`, `updated_at`) VALUES
(1, 'Acessar EndPoint Covid19 - Brasil IO - Padrão Laravel', 'Acesse os dados do Covid19 disponibilizado pelo Brasil IO - Através da Rota API. Padrão Url: /api/data/state={state}&dateStart={dateStart}&dateEnd={dateEnd}.', 'feather icon-book', 'Acessar Endpoint', '/api/data/state=PR&dateStart=2020-05-10&dateEnd=2020-05-18', '2021-02-13 20:48:44', '2021-02-13 20:48:44'),
(2, 'Acessar EndPoint Covid19 - Brasil IO - Padrão Exemplo Email', 'Acesse os dados do Covid19 disponibilizado pelo Brasil IO - Através da Rota WEB. Padrão Url: data/state={state}&dateStart={dateStart}&dateEnd={dateEnd}', 'feather icon-book', 'Acessar Endpoint', '/data/state=PR&dateStart=2020-05-10&dateEnd=2020-05-18', '2021-02-13 21:13:45', '2021-02-13 21:13:45'),
(3, 'Acessar Endpoint Percentual por Cidade - Brasil IO -Pública', 'Endpoint pública que retorna em json as 10 cidades do Brasil com maiores percentuais de casos Covid em relação a sua população estimada', 'feather icon-book', 'Acessar Endpoint', '/percentual2', '2021-02-13 21:29:00', '2021-02-13 21:30:29'),
(4, 'Acessar Endpoint Percentual por Cidade - Gazeta -Pública', 'Endpoint pública que retorna em json as 10 cidades do Brasil com maiores percentuais de casos Covid em relação a sua população estimada. Alguns dados importantes do Brasil IO estavam nulos e aparentemente não muito consistentes. Em alternativa foi utilizado os dados da Gazeta. Nas tabelas abaixo é possível verificar a  diferença de retorno entre os dados, após o calculo do percentual. XXXXXXXXXXXXXXXXXX XXXXXXXXXXX  XXXXX XXXXXXXXXXXXXX XXxX  XXXXXXXXXXXXXXXXXX XXXXXXXXXXX', 'feather icon-book', 'Acessar Endpoint', '/percentual', '2021-02-13 21:35:00', '2021-02-14 03:03:28'),
(5, 'Acessar Endpoint Percentual por Cidade - Brasil IO -PRIVADA - Requer Token', 'Endpoint privado que retorna em json as 10 cidades do Brasil com maiores percentuais de casos Covid em relação a sua população estimada. O token de autorização pode ser criado na área de Apis Tokens, no menu acima.  Dados Csv convertidos em api para uma prototipação de um cenário onde é necessário uma autorização. Para utilizar é recomendado o uso da ferramenta Postman, insira no header da requisição GET o Bearer Token criado. Requisição GET: /api/tokenizado/percentual2', 'feather icon-book', 'Acessar Endpoint', '/api/tokenizado/percentual2', '2021-02-13 21:43:00', '2021-02-13 21:45:47'),
(6, 'Acessar Endpoint Percentual por Cidade - Gazeta -PRIVADA - Requer Token', 'Endpoint privado que retorna em json as 10 cidades do Brasil com maiores percentuais de casos Covid em relação a sua população estimada. O token de autorização pode ser criado na área de Apis Tokens, no menu acima. Dados Csv convertidos em api para uma prototipação de um cenário onde é necessário uma autorização. Para utilizar é recomendado o uso da ferramenta Postman, insira no header da requisição GET o Bearer Token criado. Requisição GET: /api/tokenizado/percentual', 'feather icon-book', 'Acessar Endpoint', '/api/tokenizado/percentual', '2021-02-13 21:48:17', '2021-02-13 21:48:17'),
(8, 'Acessar retorno do Endpoint Post Interno', 'Endpoint pública que retorna em json os posts enviados para o endpoint. Acesse : /api/testApi para retornar todos os objetos cadastrados ou /api/testApi/$id para retornar um único id. Nos botões de ação da tabela abaixo: \'\'ENVIAR REQUISIÇÃO DE POST \" , clique em \"POST API EXTERNA\" para enviar os dados do objeto. Após, retorne ao modal para verificar o link de acesso para este único objeto. Você pode enviar uma requisição de post via Postman. Parâmetros: nomeUsuario,cidade,porcentagem,ranking', 'feather icon-book', 'Acessar GET do Endpoint', '/api/testApi', '2021-02-14 02:49:00', '2021-02-14 02:53:42');
